def minSkew(Text):

	sVal= 0
	minS = 0 
	minI =[]

	for i, val in enumerate(Text):
		
		if val =='G':
			sVal+= 1

		if val == 'C':
			sVal-= 1

		if sVal == minS:
			minI.append(i+1)

		if sVal < minS:
			minS = sVal
			minI = [i+1]

	print(" ".join(map(str,minI)))
	return " ".join(map(str,minI))

minSkew("")